import React from "react";
import "./css/profile.css";
import { InputInf } from "../contexts/EP";

export default function Profile() {
  const value = React.useContext(InputInf);
  return (
    <section className="cta-primary">
      <div className="cta-container">
        <div className="cta-details">
          <div className="container-info-profile">
            <p>تاريخ تسجيلك هو {value.get("dateOfLogin")}</p>{" "}
            <p>رتبتك هي {value.get("role")}</p>{" "}
            <p>بريدك الإلكتروني المرتبط بالحساب هو {value.get("email")}</p>
          </div>
        </div>
        <a className="cta-btn" href="#">
          Try it out
          <svg
            xmlns="http://www.w3.org/2000/svg"
            fill="none"
            viewBox="0 0 24 24"
            stroke="currentColor"
          >
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth={2}
              d="M13 7l5 5m0 0l-5 5m5-5H6"
            />
          </svg>
        </a>
      </div>
    </section>
  );
}
